import './Card.css';
import DeepTable from './DeepTable';

const Table = ({ team, index }) => {
  // if (entries.length > 0) {
  //   entries[3].map(entry => console.log(entry));
  // }
  team.table.map(e => console.log(e.position));

  return (
    <section>
      <table className='table'>
        <tr>
          <th>Pos</th>
          <th>Club</th>
          <th>PG</th>
          <th>W</th>
          <th>D</th>
          <th>D</th>
          <th>GF</th>
          <th>GA</th>
          <th>GD</th>
          <th>P</th>
        </tr>
        {team.table.map(e => <DeepTable e={e}/>)}
      </table>
    </section>
  )
};

export default Table;
